import { default as React, useEffect } from "react";
import 'swiper/css';
import 'swiper/css/effect-cube';
import 'swiper/css/pagination';
import { EffectCube, Pagination } from 'swiper/modules';
import { Swiper, SwiperSlide } from 'swiper/react';
import CarouselComponent from "../components/CarouselComponent";

import './Home.css';
function Home(props) {
useEffect(() => {
props.setProgress(50);
setTimeout(() => {
    props.setProgress(100);
}, 500);
}, []);
return (
<>
    <section id="section1">
    <CarouselComponent />
    </section>

    <section className="my-3" id="section2">
    <h1 className="text-center" style={{color:"whitesmoke"}}>Some Content</h1>
    </section>

    <section className="my-3" id="section3">
    <h2 className="text-center" style={{color:"whitesmoke"}}>Available for</h2>
    <div className=" text-center">
    <Swiper
        effect={'cube'}
        grabCursor={true}
        cubeEffect={{
        shadow: true,
        slideShadows: true,
        shadowOffset: 20,
        shadowScale: 0.94,
        }}
        pagination={true}
        modules={[EffectCube, Pagination]}
        className="mySwiper"
    >
        <SwiperSlide>
        <img src="https://swiperjs.com/demos/images/nature-1.jpg" />
        </SwiperSlide>

        <SwiperSlide>
            <img src="https://swiperjs.com/demos/images/nature-2.jpg" />
        </SwiperSlide>

        <SwiperSlide>
            <img src="https://swiperjs.com/demos/images/nature-3.jpg" />
        </SwiperSlide>

        <SwiperSlide>
            <img src="https://swiperjs.com/demos/images/nature-4.jpg" />
        </SwiperSlide>
    </Swiper>
    </div>
    </section>

    <section className="my-3" id="section4">
    <h2 style={{color:"whitesmoke"}} className="text-center">About us</h2>
    </section>
</>
);
}

export default Home;
